package day3operators;

import java.util.Scanner;

public class assignmentoperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		{
				Scanner s=new Scanner(System.in);
				int a=s.nextInt();
				int b=s.nextInt();
				a*=b;//a=a*b
				System.out.println(a);
				s.close();

			}
	}
}